import styled from "styled-components";

 export const Head = styled.header`
   border: 1px solid red;
   background-color: var(--myDark-color);
   display:flex;
 `;
 export const Logo = styled.figure`
   border: 1px solid red;
   width: 20%;
   & img{
   background-color: var(--second-color);
     width:100px;
     height:50px;
   }
 `;
